import { Test, TestingModule } from '@nestjs/testing';
import { INestApplication } from '@nestjs/common';
import * as request from 'supertest';
import { AppModule } from './../src/app.module';
import * as express from 'express';

describe('AppController', () => {
  let app: INestApplication;

  beforeEach(async () => {
    const moduleFixture: TestingModule = await Test.createTestingModule({
      imports: [AppModule],
    }).compile();

    app = moduleFixture.createNestApplication();
    await app.init();
    app.use(express.json({ limit: '50mb' })); // Adjust the limit as needed
    app.use(express.urlencoded({ limit: '50mb', extended: true }));
  });

  it('/create-image (POST)', () => {
    return request(app.getHttpServer())
      .post('/create-image')
      .send({
        image1:
          '',
        image2:
          '',
        featureIndex: Math.floor(Math.random() * 39),
      })
      .expect(201) // Assuming 201 is the expected status code for a successful creation
      .then((response) => {
        // Here you can add assertions based on your response structure
        expect(response.body).toHaveProperty('prompt');
        expect(response.body).toHaveProperty('url');
      });
  });

  // Add additional test cases as needed, e.g., for handling errors

  afterAll(async () => {
    await app.close();
  });
});
